import React from 'react';
import EditItem from './components/EditItem'
import { useNavigate } from "react-router-dom";
import Axios from 'axios';
import { models } from 'mongoose';
import { useParams } from 'react-router-dom';

function EditItemPage(props) {
  const navigate = useNavigate();

  const { id } = useParams();

  Axios.get(`http://localhost:8080/pins/${id}`)
  .then(response => {
    console.log("RESPONSE: " + response);
  })
  .catch(error => console.log(error));

    const itemEditHandler = async function(itemData) {
        var name;
        var img;
        var description;
        await Axios.put(`http://localhost:8080/pins/${id}`, itemData)
        .then(response => {
            name = response.name;
            img = response.img;
            description = response.description;
        })
        .catch(error => console.log(error));
        navigate('/loggedin')
    };

  return (
    <div>
        <EditItem currName={name} currImg={img} curDescription={description} onEditItem={itemEditHandler} />
    </div>
  );
}

export default EditItemPage;
